import { useContext } from 'react';
import './Expense.css';

const ExpenseItem = (props) => {

  return (
    <li >
      <div>
        <div class="cellContainer">{props.Description}</div>
        <div class="cellContainer">{props.Year}</div>
        <div class="cellContainer" >{props.Amount}</div>
        <div class="cellContainer" >{props.Day}</div>
        <div class="cellContainer" >{props.Month}</div>
      </div>
    </li>
  );
};

export default ExpenseItem;
